import React from 'react';
import styles from './SignIn.module.css'

class SignIn extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            signInEmail: '',
            signInPassword: ''
        }
    }

    onEmailChange = event => {
        this.setState({ signInEmail: event.target.value })
    }

    onPasswordChange = event => {
        this.setState({ signInPassword: event.target.value })
    }

    onSubmitSignIn = () => {
        console.log(this.state)
        this.onRouteChange('home')
    }

    render() {
        const { onRouteChange } = this.props;
        return (
            <main className={styles.formContainer}>
                <form className={styles.form}>
                    <fieldset id="sign_up" className={styles.signInFields}>
                        <legend>Sign In</legend>
                        <div>
                            <label className="label" htmlFor="email-address">Email</label>
                            <input className="input" type="email" name="email-address"  id="email-address"></input>
                        </div>
                        <div>
                            <label className="label" htmlFor="password">Password</label>
                            <input className="input" type="password" name="password"  id="password"></input>
                        </div>
                    </fieldset>
                    <div>
                        <input className="button" onClick={this.onSubmitSignin} type="submit" value="Sign in"></input>
                    </div>
                    <div>
                        <p className="link" onClick={() => onRouteChange('register')} >Sign up</p>
                    </div>
                </form>
            </main>
        )
    }

}

export default SignIn;
